import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { MapPin, Heart, Scale } from 'lucide-react';
import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';

const ArticleDisplay = ({ articles }) => {
  const [selectedSentiment, setSelectedSentiment] = useState('all');

  const sentiments = [
    { id: 'all', label: 'All Stories', color: 'bg-slate-500' },
    { id: 'positive', label: 'Positive', color: 'bg-emerald-500' },
    { id: 'neutral', label: 'Neutral', color: 'bg-blue-500' },
    { id: 'negative', label: 'Learning Opportunities', color: 'bg-amber-500' }
  ];

  const getBiasColor = (rating) => {
    const colors = {
      '1': 'text-blue-600',
      '2': 'text-blue-400',
      '3': 'text-slate-500',
      '4': 'text-amber-400',
      '5': 'text-amber-600'
    };
    return colors[rating] || 'text-slate-500';
  };

  return (
    <div className="min-h-screen bg-slate-50 p-6">
      {/* Sentiment Filter Tabs */}
      <div className="flex justify-center space-x-4 mb-8">
        {sentiments.map((sentiment) => (
          <button
            key={sentiment.id}
            onClick={() => setSelectedSentiment(sentiment.id)}
            className={`px-4 py-2 rounded-full transition-all duration-300 ${
              selectedSentiment === sentiment.id
                ? `${sentiment.color} text-white`
                : 'bg-white text-slate-600 hover:bg-slate-100'
            }`}
          >
            {sentiment.label}
          </button>
        ))}
      </div>

      {/* Article Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {articles?.map((article) => (
          <motion.div
            key={article.id}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
          >
            <Card className="overflow-hidden hover:shadow-lg transition-shadow duration-300">
              <div className="h-48 overflow-hidden">
                <img
                  src={article.image?.url || '/api/placeholder/400/320'}
                  alt={article.title}
                  className="w-full h-full object-cover"
                />
              </div>

              <CardHeader>
                <div className="flex items-center justify-between mb-2">
                  <div className="flex items-center space-x-2">
                    <MapPin className="w-4 h-4 text-slate-400" />
                    <span className="text-sm text-slate-600">{article.geographicLocation}</span>
                  </div>
                  <div className={`flex items-center ${getBiasColor(article.sourceOutlet?.biasRating)}`}>
                    <Scale className="w-4 h-4 mr-1" />
                    <span className="text-sm">Bias Rating: {article.sourceOutlet?.biasRating}</span>
                  </div>
                </div>
                <CardTitle className="text-xl font-serif">{article.pageName}</CardTitle>
              </CardHeader>

              <CardContent>
                <p className="text-slate-600 mb-4">{article.summary}</p>
                <div className="flex items-center justify-between">
                  <div className="flex items-center space-x-2">
                    <img
                      src={article.sourceOutlet?.logo?.url || '/api/placeholder/32/32'}
                      alt={article.sourceOutlet?.name}
                      className="w-8 h-8 rounded-full"
                    />
                    <span className="text-sm text-slate-500">{article.sourceOutlet?.name}</span>
                  </div>
                  <div className="flex items-center text-rose-500">
                    <Heart className="w-4 h-4 mr-1" />
                    <span className="text-sm">42</span>
                  </div>
                </div>
              </CardContent>
            </Card>
          </motion.div>
        ))}
      </div>
    </div>
  );
};

export default ArticleDisplay;
